import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "information";
const pathData = "M256 0c141 0 256 115 256 256S397 512 256 512 0 397 0 256 115 0 256 0zm38 140c0-21-17-39-38-39s-38 18-38 39 17 38 38 38 38-17 38-38zm-6 238V250c0-18-14-32-32-32s-32 14-32 32v128c0 17 14 32 32 32s32-15 32-32z";
const ltr = false;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
